import React from 'react';
import { Redirect, Route } from 'react-router-dom';
import { isLogin } from '../../Utils/Index';

function Apoiment({component: Component, ...rest}) {
    return (
        <Route {...rest} render = {props => (
            isLogin() ?
                <Component {...props}/>
            :
                <Redirect to={"/login"}/>
        )}
        />
    );
}

export default Apoiment;
